package com.dingapp.biz.db.orm;public class ScoreChildChildBean {	private String date;	private String title;	private String detail;	private int score;	public String getDate() {		return date;	}	public void setDate(String date) {		this.date = date;	}	public String getTitle() {		return title;	}	public void setTitle(String title) {		this.title = title;	}	public String getDetail() {		return detail;	}	public void setDetail(String detail) {		this.detail = detail;	}	public int getScore() {		return score;	}	public void setScore(int score) {		this.score = score;	}}